import React from "react";
const Home = () => {
  const btn = {
    width: "250px",
    height: "30px",
    textAlign: "center",
    backgroundColor: "lightyellow",
  };
  return (
    <>
      <div>
        <button style={btn}>Login</button>
        <hr />
        <h1>Welcome to Login Page</h1>
        <h1></h1>
      </div>
    </>
  );
};
export default Home;
